import React from "react";
import EventCard from "./EventCard.jsx"
import events from "../events.js";

// const [events, setEvents] = useState([events]);

function Events() {
    return (
        <div>   
            <h2>Recommended Events</h2>
            {
                events.map((event)=>{
                    return(
                    <EventCard
                        key={event.key}
                        eventInfo={event}
                    />
                    )
                })
            }
        </div>
    )
}
export default Events;
